import react from "react";
import React from "react";
import "./AsideCard.scss";

const AsideCard = (props) => {
  return (
    <div>
      <ul className="video-list">
        {props.videos.map((video) => (
          <p>
            {video.title}
            {video.channel}
            {video.image}
          </p>
        ))}
        <li>video list</li>
      </ul>
    </div>
  );
};

export default AsideCard;
